import React from "react";
import Link from "next/link";

export const Users = (props) => {
  let users = "";
  console.log(props, "de users");

  return (
    <ul>
      {props.users.map((user) => (
        <div>
          <li key={0}>
            {user.name} + <br /> + {user.website}
          </li>
        </div>
      ))}
    </ul>
  );
};

export default Users;
